import React,{useState} from "react";
import '../cssFile/EachListItem.css'
import { Link } from 'react-router-dom'

export default function EachListItem(props) {
  const [name,setName] = useState("nameHeere");
  return (
    <li onClick={props.setItemToMain()} id="profileItem">
      <img id="profileImg" src={props.Item.imgSrc} />
      <h4 id="profileTittle">{props.Item.tittle}</h4>
      <small id="profilePrice">{props.Item.price}$</small>
    </li>
  );
}
